import { useState } from "react";
import InputCheckbox from "../../../../UI/InputCheckbox/InputCheckbox";

import style from "./OptionCheckbox.module.css";

function OptionCheckboxIncome(props) {
  const [cheked, setChecked] = useState(true);

  function changeCheckedHandler() {
    setChecked((prev) => !prev);
  }

  return (
    <div className={style.checkbox}>
      <p>Customize Your Chart</p>
      <div className={style["checkbox__container"]}>
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="job"
          label="Job"
          checked={cheked}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="stack"
          label="Stack"
          checked={cheked}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="windfall"
          label="Windfall"
          checked={cheked}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="others"
          label="Others"
          checked={cheked}
        />
      </div>
    </div>
  );
}

export default OptionCheckboxIncome;
